import React, { Component } from 'react'
import Team from './Team'
import Header from './Header'

class App extends Component{
    constructor() {
        super()
    }
    render() {
        return (
            
               
                <div className="container mt-2 text-center">
                <Header />
              <Team/>  
                </div>
               
        )
    }
}

export default App
